import React from 'react';
import { Container, Navbar, Button, Col } from 'react-bootstrap';
function Header() {
  return (
    <Navbar bg="dark" variant="dark" sticky="bottom" className="d-flex justify-content-center">
      <Container>
        <Col>
          <Button variant="outline-info">Top!</Button>
        </Col>
        <Col xs={6}></Col>
        <Col>
          <Navbar.Brand href="#home">Incli</Navbar.Brand>
        </Col>
      </Container>
    </Navbar>
  );
}

export default Header;
